import React, { useState, useEffect } from "react";
import "../../styles/LandingPage.scss";
import "../../styles/LoadingScreen.css";
import "../../styles/Geo.css"
import "../Geo.js";
import { NavLink } from "react-router-dom";
//import anime from "animejs/lib/anime.es";
import { Fade } from "react-reveal";
import Footer from "../components/Footer";
import Navbar from "../components/Header";
import graphic from "../../static/media/test-about3.png";
import arrow_right from "../../static/media/arrow-right.svg";

// fetch('https://firebasestorage.googleapis.com/v0/b/mounting-ethanwwm.appspot.com/o/landing-page-gradient.svg?alt=media&token=070e018b-3a68-4d8f-9ef6-600a5aaf129c').then((res)=>{
//   console.log(res)
// }).catch(()=>{
//   console.log('failed to get')
// })

const LandingPage = () => {
  return (
    <React.Fragment>
      <Navbar />
      <div className="landing-page-parent">
        {graphic ? (
          <Fade top>
            <div id="geo-globe">
              <canvas id="canvas"></canvas>
            </div>
            {/* <img
              className="graphic"
              src={graphic}
              alt="graphic"
            /> */}
            <h1 className=" react-reveal large-text-header">
              Data
              <br />
              Analyst
            </h1>
          </Fade>
        ) : undefined}
        
        <Fade cascade>
          <div className="landing-text-area">
            {/* <h1 className="large-text">
              Data             
              <br />
              Analyst
            </h1> */}
            <h1>
              Matt Ly
            </h1>
            <div className="buttons">
              <NavLink to="/experience" exact>
                <div className="gradient-button">
                  <p>View Experience</p>
                  <img src={arrow_right} alt="" className="arrow-right" />
                </div>
              </NavLink>

              <div
                className="outline-button"
                onClick={() => {
                  window.location.href = "mailto:mattlyldc21@gmail.com";
                }}
              >
                <p>Let's talk!</p>
              </div>
            </div>
          </div>
        </Fade>

        <div className="footer-div">
          <Footer />
        </div>
      </div>
    </React.Fragment>
  );
};

export default LandingPage;
